import React from 'react'

export default function Button({text, onClick=()=>{},color="gray"}){

    // Here text=button with default prop called color.
    return(
        <button 
        onClick={onClick}
        style={{backgroundColor:color, padding:"5px 20px", borderRadius:25}}>
        {text}
        </button>
    );
}
